const Login = () => {
	return (
		<>
			<div>
				<label>Email</label>
				<input placeholder="abc@mail.com" />
				<small >Help text</small>
			</div>
			<div>
				<label>Password</label>
				<input type="password" />
			</div>
		</>
	);
}

export default Login;
